Unsere Prüfungsplanung basiert auf einem risiko- und systemorientierten Prüfungsansatz
und beinhaltet eine Prüfungsstrategie. Die Prüfungsstrategie wiederum wird auf Grundlage
einer Risikoanalyse festgelegt, welcher folgende Prämissen zugrunde lagen:

e Verständnis des wirtschaftlichen Umfelds, der Ziele und Strategien der Gesellschaft;

e Verständnis für diejenigen Risiken, welche zu falschen Angaben im Jahresabschluss
führen können;

«e Plausibilitätsüberlegungen und weitere analytische Prüfungshandlungen zum Zwecke
der vorläufigen Risikoeinschätzung;

e Verständnis für die Auswahl der zur Anwendung gelangten Rechnungslegungsmetho-
den;

«e Verständnis für die laufende Überwachung des wirtschaftlichen Erfolgs der Gesell-
schaft;

e Verständnis und Beurteilung des internen Kontrollsystems der Gesellschaft.
